# Use the health dataset here, not df
m = folium.Map(location=[-37.8136, 144.9631], zoom_start=12)
mc = MarkerCluster().add_to(m)

coord_ok = {"latitude", "longitude"}.issubset(health.columns)
if not coord_ok:
    raise ValueError("No latitude/longitude columns to map in health dataset.")

for _, r in health.iterrows():
    lat, lon = r["latitude"], r["longitude"]
    if pd.notna(lat) and pd.notna(lon):
        tooltip = str(r.get("feature_name", "Health Service"))
        popup_lines = []
        if "sub_theme" in health.columns: popup_lines.append(f"Type: {r.get('sub_theme','Unknown')}")
        if "suburb" in health.columns:    popup_lines.append(f"Suburb: {r.get('suburb','')}")
        popup = "<br>".join(popup_lines) if popup_lines else "Health Service"
        folium.Marker([lat, lon], tooltip=tooltip, popup=popup).add_to(mc)

